import React from 'react'
import { Typewriter } from 'react-simple-typewriter'
import './Home.css'
//import img from'../../Assets/2.jpg'
import { Bio } from '../../data/Constants'

const Home = () => {
 
//  const {text} = useTypewriter({
//   words:["Avik","Ayush"],
//   loop: {},
// })
 
  return (
    <div className='hero'>
      {/* <div className='photo'>
        <img src={img} alt='Not Available' />
      </div> */}

      <div className='content'>
        <p>Hello, Welcome to my site</p>
        <h1>Hi, I'm {Bio.name}</h1>
        <h2>
        <Typewriter
            words={Bio.roles}
            loop={5}
            cursor
            cursorStyle='_'
            typeSpeed={100}
            deleteSpeed={50}
            delaySpeed={1000}
            
          />
        </h2>
      </div>
    </div>
  )
}

export default Home
